スッキリとしたシルエットで脚をキレイに見せてくれる大人のロングレインブーツ。
履き口に、お手入れが簡単で丈夫な合成皮革を使用したMeduseのロングレインブーツ「FLANCUIR」。
すっきりとしたシルエットで大人っぽく履くことができ、雨の日もスタイリッシュな雰囲気に。
ラバー素材を一体成型で仕上げた防水性の高い作りで、雨の日の頼もしい相棒になってくれる一足です。
ヒールは歩きやすい2.5cm。また、かかとには脱着を助けてくれるヒールキックが施されていたりと、
快適に履いて頂ける一足となっています。<br>

