ジョッキーブーツの様な、すっとしたシルエットがエレガントな雰囲気に♪ <br>
履き口周りには、本革の様なツヤのある素材を使用。 <br>
アウトソールには細かな凸凹を作り、水はけが良く、小石も詰まりにくくなっているので 快適に歩いていただけます。  <br>
 <br>
商品名：長靴 SURZO レインブーツ レディース長靴 ロング切り替え縦ベルトETSR-5033<br>
 <br>
サイズ：S（22.5-23cm）、M（23.5-24cm）、L（24.5-25cm）　※メジャーで採寸しておりますので、若干の差異がある場合がございます。<br>
 <br>
材質：PVC<br>
 <br>
カラー：BLACK/BROWN（ブラック/ブラウン） 、BLACK（ブラック）、BROWN（ブラウン）<br>
<br>
注意事項：天然ゴムの性質上、製造過程で表面に小さな膨らみ・気泡・内側のライニング生地色の一部変色・多少の傷・色むら・個体差等がある場合もございます。こちらは初期不良品ではございませんのであらかじめご了承ください。返品交換対象外となります。<br>

ラバー表面に白色の粉のようなものが現れる場合があります。こちらは紫外線の影響を防ぐためゴムにワックスが加えられているために起こる現象となっております。
湿ったスポンジでやさしく拭き、その後乾いた布で乾拭きしてください。
<br>
実際の商品になるべく近い色を再現しておりますが、ご覧になっているモニターの色の違いにより、実際の商品と色合いが異なる場合がございます。あらかじめご了承ください。<br>
